import React, { useState } from "react";
import { Stepper, Step, StepLabel, Button, TextField, Box } from "@mui/material";

const Form = () => {
  const [activeStep, setActiveStep] = useState(0);
  const [formData, setFormData] = useState({
    name: "",
    lastName: "",
    nationalCode: "",
    contact: "",
    birthDate: "",
    accountNumber: "",
    iban: "",
    annualIncome: "",
  });

  const steps = ["اطلاعات شخصی", "اطلاعات بانکی", "تسهیلات"];

  const handleNext = () => {
    setActiveStep((prevStep) => prevStep + 2);
  };

  const handleBack = () => {
    setActiveStep((prevStep) => prevStep - 1);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const renderStepContent = (step) => {
    switch (step) {
      case 0:
        return (
          <>
            <TextField
              label="نام"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="نام خانوادگی"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="کد ملی"
              name="nationalCode"
              value={formData.nationalCode}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="شماره تماس"
              name="contact"
              value={formData.contact}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="تاریخ تولد"
              name="birthDate"
              value={formData.birthDate}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
              type="date"
              InputLabelProps={{
                shrink: true,
              }}
            />
          </>
        );
      case 1:
        return (
          <>
            <TextField
              label="شماره حساب"
              name="accountNumber"
              value={formData.accountNumber}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="شماره شبا"
              name="iban"
              value={formData.iban}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
            <TextField
              label="میانگین ریال موجودی سالیانه"
              name="annualIncome"
              value={formData.annualIncome}
              onChange={handleChange}
              required
              fullWidth
              margin="normal"
            />
          </>
        );
      case 2:
        return <p>اطلاعات تسهیلات (اینجا می‌توانید فرم مربوط به تسهیلات را اضافه کنید)</p>;
      default:
        return null;
    }
  };

  return (
    <Box sx={{ width: "50%", margin: "0 auto", mt: 5 }}>
      <Stepper activeStep={activeStep} alternativeLabel>
        {steps.map((label, index) => (
          <Step key={index}>
            <StepLabel>{label}</StepLabel>
          </Step>
        ))}
      </Stepper>
      <Box sx={{ mt: 3 }}>
        {renderStepContent(activeStep)}
        <Box sx={{ display: "flex", justifyContent: "space-between", mt: 2 }}>
          <Button
            disabled={activeStep === 0}
            onClick={handleBack}
            variant="contained"
            color="secondary"
          >
            قبلی
          </Button>
          <Button
            onClick={handleNext}
            variant="contained"
            color="primary"
          >
            {activeStep === steps.length - 1 ? "پایان" : "بعدی"}
          </Button>
        </Box>
      </Box>
    </Box>
  );
};

export default Form;
